import React, { Component } from "react";
import "./App.css";
import Contract from "./Contract.js";

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          <div className="App-header">
            <h1 className="App-title">Contract Form</h1>
          </div>
        </header>
        <Contract />
      </div>
    );
  }
}

export default App;
